script: |
  super -f text -I q1623.spq | sort > q1623.out

inputs:
  - name: q1623.spq
    data: |
      SELECT ALL col0 + + col1 FROM tab1 (FORMAT parquet) WHERE NOT - col2 BETWEEN + - 53 * - col0 * 51 AND - 43 - + col0 + + col1 * + col0;
  - name: tab1

outputs:
  - name: q1623.out
    data: |
      138
      65
      90
